import React from "react";
import { useParams } from "react-router-dom";
import './Weather.css';

const Weather = () => {
    const { id } = useParams();
    console.log(id + "from params");
    return (
        <div>
            Hello from Weather {id}
        </div>
    );
}

export default Weather;
